import React from "react";

export default function FloatingActionButton({ onClick }: { onClick?: () => void }) {
  const fabStyle: React.CSSProperties = {
    position: 'fixed',
    left: '50%',
    transform: 'translateX(-50%)',
    bottom: 80, // 하단 내비게이션 위에 띄우기
    zIndex: 1100,
    width: '100%',
    maxWidth: 320,
    margin: '0 auto',
    display: 'flex',
    justifyContent: 'center',
  };

  return (
    <button
      onClick={onClick}
      style={fabStyle}
      aria-label="캐릭터 만들기"
    >
      +
    </button>
  );
}
